import React, { useState } from "react";
import { useRouter } from "next/router";
import { Button } from "@/components/ui/button";

const HomePage = () => {
  const router = useRouter();

  const handleGoToProfile = () => {
    router.push("/profile");
  };

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-100 p-4">
      {/* UI similar to the image */}
      <div className="bg-white shadow-lg rounded-2xl p-6 w-full max-w-md text-center">
        <h1 className="text-2xl font-bold mb-4">Welcome to My Site</h1>
        <p className="text-gray-600 mb-6">This is a UI similar to your provided image.</p>

        {/* Go to My Profile Button */}
        <Button onClick={handleGoToProfile} className="bg-green-500 text-white px-4 py-2 rounded-lg">
          Go to My Profile
        </Button>
      </div>
    </div>
  );
};

export default HomePage;
